import React from 'react';
import './CSS/App.css'
import { Container, Input, Grid, Header} from 'semantic-ui-react'

class Fridge extends React.Component {
  render() {
    return (
      <div>
        <Header as='h1'> 냉장고 </Header>
        <Input placeholder='재료추가' />
      </div>
    );
  }
}

class Results extends React.Component {
  render() {
    return (
      <Header as='h1' dividing>
        Using Grids
      </Header>
    );
  }
}

class App extends React.Component {
  render() {
    return (
      <Container>
        <Grid columns={2} relaxed='very'>
          <Grid.Column>
            <Fridge />
          </Grid.Column>
          <Grid.Column>
            <Results />
          </Grid.Column>
        </Grid>
      </Container>
    );
  }
}


export default App;
